import React, {Fragment} from 'react';
import "./App.scss";
import { Container, Section } from 'rbx';
import Header from "./components/header";
import Routes from './routes';
import ModalRoot from './components/modals';

const App = () => (
  <Fragment>
    <Header all/>
    <Section>
      <Container>
        <Routes/>
      </Container>
    </Section>
    <ModalRoot />
  </Fragment>
)

export default App;
